import React, { useEffect, useState } from "react";
import axios from "axios";

export default function App() {
  useEffect(() => {
    console.log("test");

    let data = JSON.stringify({
      username: "test",
      password: "123",
    });

    let config = {
      method: "post",
      maxBodyLength: Infinity,
      url: "http://localhost:5000/auth",
      headers: {
        "Content-Type": "application/json",
        Cookie:
          "connect.sid=s%3A2SkxK0DlR8U2Z7m50OnH2z8niyjMyycq.jgUlEkuAIRfOOJFYAOUq0GfUpkW7wePY9cIAO335oCs",
      },
      data: data,
    };

    axios
      .request(config)
      .then((response) => {
        console.log(JSON.stringify(response.data));
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return <div>test</div>;
}
